import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

interface FormValues {
  accomodation: string;
  attraction: string;
  audience: string;
  contact: string;
  dateEvent: string;
  endAt: string;
  eventName: string;
  food: string;
  location: string;
  requester: string;
  startAt: string;
  transport: string;
  eventKind: string;
}

export function checkListDocument(dataEvent: FormValues) {
  pdfMake.vfs = pdfFonts.pdfMake.vfs;
  const dateEvent = new Date(dataEvent.dateEvent).toLocaleDateString("pt-BR");

  const logoPMBA =
    "data:image/png;base64,";

  var docDefinition = {
    pageSize: "A4",
    pageMargins: [20, 5, 30, 20],
    content: [
      {
        image: logoPMBA,
        width: 120,
        height: 120,
        alignment: "center",
      },
      {
        text: `POLCIA MILITAR DA BAHIA\n COMANDO DE POLICIAMENTO REGIONAL SUL - ILHUS\n 69 COMPANHIA INDEPENDENTE DE POLCIA MILITAR - ILHUS\n\n CHECK LIST PARA ORGANIZADORES DE EVENTOS\n\n`,
        style: "header",
        alignment: "center",
      },
      {
        text: "Diante da demanda dos eventos que ensejam a participao da Polcia Militar (PMBA), como: Shows, Festas, Confraternizaes, e outros, bem como, por normatizao das instncias superiores da instituio, informamos aos organizadores dos eventos que os ofcios endereados a esta unidade, 69 a CIPM, devem obedecer s   seguintes normas, ficando sujeitos a recusa de recebimento e conseqente escala do policiamento quando no cumpridos:\n\n",
        style: "small",
      },
      "OFICIO COM ANTECEDNCIA MNIMA DE 15 DIAS DO INICIO DO EVENTO ENDEREADO AO MAJ PM CLAUDIO DOS SANTOS COSTA LOPES COMANDANTEDA 69 a CIPM - ILHUS,DEVER CONTER NA SOLICITAO:\n*NOME DO RESPONSVEL E TELEFONE PARA CONTATO\n*PERODO*\nLOCAL DO EVENTO*\nATRACES*\nESTIMATIVA DE PBLICO\n*TRANSPORTE (a cargo do solicitante)\n*ALIMENTAO (a cargo do solicitante)\n*HOSPEDAGEM (quando for o caso)ANEXO AO OFCIO DEVER CONTER OS SEGUINTES DOCUMENTOS:\n -	AUTORIZAO DA PREFEITURA MUNICIPAL PARA REALIZAO DO EVENTO;\n-	LAUDO DE VISTORIA DO ESPAO, REALIZADO PELO CORPO DE BOMBEIROS;\n\n",
      {
        text: "FORMULRIO DE SOLICITAO DE POLICIAMENTO\n\n",
        style: "subheader",
      },
      {
        style: "tableExample",
        table: {
          body: [
            ["NOME DO EVENTO", `${dataEvent.eventName}`],
            ["NOME DO SOLICITANTE/RESPONSVEL", `${dataEvent.requester}`],
            ["DATA DO EVENTO", `${dateEvent}`],
            ["HORRIO DE INCIO", `${dataEvent.startAt}`],
            ["HORRIO DE TRMINO", `${dataEvent.endAt}`],
            ["LOCAL DO EVENTO", `${dataEvent.location}`],
            ["ATRAES", `${dataEvent.attraction}`],
            ["ESTIMATIVA DE PBLICO", `${dataEvent.audience}`],
            [
              "TRANSPORTE",
              `${dataEvent.transport ? dataEvent.transport : "Sem previso"}`,
            ],
            [
              "ALIMENTAO",
              `${dataEvent.food ? dataEvent.food : "Sem previso"}`,
            ],
            [
              "HOSPEDAGEM",
              `${
                dataEvent.accomodation ? dataEvent.accomodation : "Sem previso"
              }`,
            ],
            ["CARACTERSTICA DO EVENTO", `${dataEvent.eventKind}`],
            ["CONTATOS", `${dataEvent.contact}`],
          ],
        },
      },
    ],
    styles: {
      header: {
        fontSize: 16,
        bold: true,
      },
      subheader: {
        fontSize: 15,
        bold: true,
      },
      quote: {
        italics: true,
      },
      small: {
        fontSize: 12,
      },
    },
  };
  pdfMake.createPdf(docDefinition).download();
}
